import Navbar from "./components/navbar";
/* import Section from "./components/section"; */
import FrmAgregar from "./components/FrmAgregar";
import ListarPeliculas from "./components/ListarPeliculas";

function App() {
  return (
    <>
      <Navbar />
      <div className="row">
        <div className="col-9">
          <ListarPeliculas />
        </div>
        <div className="col-3">
          <FrmAgregar />
        </div>
      </div>
    </>
  );
}

export default App;
